window.bookSummaryJSON = "<p><b>Alpha Team Battles Its Greatest Nemesis </b></p> <p>With Juice in heavy contact on the do-or-die shore mission, Ali in a blistering sniper duel over the South Atlantic, and Homer all alone and massively outnumbered deep beneath the keel of the <i>JFK</i>, the Alpha operators are in the fight of their lives - against tactically outstanding, pain-invulnerable, and utterly merciless Spetsnaz commandos and with no guarantees about who will be left standing at the end.... </p> <p><b>The <i>JFK</i> Clings to Survival </b></p> <p>Perilously low on ammo, fuel, planes, pilots, and options, and seemingly outmaneuvered at every turn, the beleaguered <i>John F. Kennedy</i> engages in a lethal game of cat and mouse with the gigantic and weapons-bristling Russian battlecruiser - with not just their lives on the line but the lives of everyone on the planet.... </p> <p><b>One Troop Fights Furiously to Hold the Center </b></p> <p>As London comes under unrelenting siege, Jameson and the Royal Marines face down a lightning-fast and terrifyingly uncontrolled outbreak in CentCom's Strategic Command Center - the beating heart of humanity's last defenses against the dead - and with no one but them standing in the way of total collapse and utter devastation.... </p>"; 
